import React, { useEffect, useState } from 'react';
import './xx.scss';
const XX= ()=> {

  const [offset, setOffset] = useState(0);

  useEffect(() => {
    window.onscroll = () => {
      setOffset(window.pageYOffset)
    }
  }, []);
return(<>
  <header id="home_header"></header>
  <h1>{offset}</h1>
</>
)

};
export default XX;
